import React from 'react';

const Restaurant = ({ logo, name, description }) => {
  return(
    <article>
      <img src={ logo } alt></img>
      <div>
        <h2>{ name }</h2>
        <p>{ description }</p>
      </div>
    </article>
  )
}

export default Restaurant;
